import React from 'react'
import css from "../components/menu.css"
import data from "../data/menuItems.json"


class Menu extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        console.log(data)
        const listItems = data.map((d) => <li key={d.name}>{d.name}</li>)
        return(
            <div>
                <div className={css.menuContainer}></div>
            </div>
        )
    }

}


export default Menu

